.resume{
    overflow-x: hidden;
    .menu-icon{
        position: fixed;
        right: 36px;
        top:45px;
        padding:0px;
        z-index: 10;
        .fa{
            font-size: 2rem;
            &:hover{
                color: white;
            }
        }

    }
    .menu{
        display: none;
    }
    .info-section{
        padding: 40px;
        width:35%;
        position: absolute;
        top:20px;
        bottom: 0;
        .logo{
            margin-top: 20px;
            margin-left: 20px;
            border: 5px solid #ffffff;
            height: 60px;
            width: 100px;
            display: flex;
            justify-content: center;
            align-items: 4rem;
            color: #ebeae7;
            line-height: 2;
            border-radius: 4px;
            font-size: 25px;
            font-weight: 600;
        }
    }
    .content-area{
        background: #ebeae7;
        margin-left: 22%;
        width: 80%;
        height: 100vh;
        overflow-x: hidden;
        .scroll-section{
            overflow-y: scroll;
            overflow-x: hidden;
            padding-left: 50px;
            h1{
                padding-bottom:10px ;
                padding-left: 0px;
                padding-top: 50px;
                font-weight:550;
                font-size: 2rem;
                color: blue;
                margin-bottom: 56;
                text-transform: uppercase;

            }
            h5{
                font-weight: 500;
                font-size: 1.2rem;
                text-transform: uppercase;
                color: blue;
            }
            .xp-section{
                display: grid;
                grid-template-columns: 1fr 1fr;
                grid-column-gap: 50px;
                grid-row-gap: 20px;
                max-width: 900px;

                .xp-box{
                    cursor: pointer;

                    transition: all 0.5, ease-in-out;
                    &:hover{
                        -webkit-box-shadow: 0px 1px 13px 0px rgba(0,0,0,0.71);
                        -moz-box-shadow: 0px 1px 13px 0px rgba(0,0,0,0.71);
                        box-shadow: 0px 1px 13px 0px rgba(0,0,0,0.71);
                    }
                }
                a{
                    text-decoration: none;
                    color:#a9a9a9;
                }
                h5{
                    font-weight: 500;
                    font-size: 1.3rem;
                    margin-bottom: 1rem;
                }
                p{

                    font-weight: 300;
                    font-size: 1rem;
                    margin-bottom: 1rem;
                }
            }

        }
    }

}
// Small devices (landscape phones, 576px and up)
@media(max-width: 767px){
